import React from 'react';
import Random from './Random';
import Card from './layout/Card';


export default () => {
    return (
        <div>
            <h1>Fundamentos React</h1>
            <div className="flex">
                <Card titulo="Random">
                    <Random min={10} max={20} />
                </Card>
            </div>
        </div>
    )
}
